	add("police", "{\"term\":\"police\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027police\u0027 from Latin \u0027politia\u0027 (state, government) from Ancient greek (to 1453) {{m|grc|πολιτεία}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"plurale_tantu\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"plurale tantum\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A civil force granted the legal authority for law enforcement and maintaining public order\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d18|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003d‘Then the father has a great fight with his terrible conscience,’ said Munday with granite seriousness. ‘Should he make a row with the \u0027\u0027police\u0027\u0027 […]? Or should he say nothing about it and condone brutality for fear of appearing in the newspapers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A police officer\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Policy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Communal living; civilization\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The regulation of a given community or society; administration, law and order etc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Greta Nation\u0027, Penguin 2003, p. 218\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The notion of ‘\u0027\u0027police\u0027\u0027’ – that is, rational administration – was seen as a historical force which could bring civilized improvement to societies\", \"priority\":10}]}, \"synonyms\":{}}");

