	add("politesse", "{\"term\":\"politesse\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From the French \u0027politesse\u0027 from the Italian \u0027politezza\u0027 from \u0027polito\u0027 past participle of \u0027pulire\u0027 (lang\u003dit) from the Latin \u0027polire\u0027 () present active infinite form of \u0027poliō\u0027 (i polish”, “i smooth)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Civility, politeness, courtesy or gallantry; or an instance of this\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, \u0027The Sea, The Sea\u0027, Vintage 1999, pp. 56-7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The reference in his letter to ‘having a drink’ is of course just an empty \u0027\u0027\u0027politesse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Thomas Penn, \u0027Winter King\u0027, Penguin 2012, p. 7\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The soft \u0027\u0027politesse\u0027\u0027 concealed a sharp observer, a gleaner of information, cool under pressure and used to having to think several steps ahead […\", \"priority\":5}]}, \"synonyms\":{}}");

	add("politician", "{\"term\":\"politician\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|politic|ian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One engaged in politics, especially an elected or appointed government official\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/international/21584335-making-fun-leaders-pleasure-enjoyed-ever-more-people-satirical-verses The Satirical passage\u003dIt is not just \u0027\u0027politicians\u0027\u0027 who find aspects of the explosion in satire unwelcome. Thanks to the internet, professional purveyors of the stuff face a lot more competition. For once, the joke is at their expense. A niche craft practised by a talented few has turned into a globally popular hobby, and what was once considered audacious commentary is now mainstream\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Specifically, one who regards elected political office as a career\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"isbn\u003d0399142185|title\u003d[http://books.google.com/books?id\u003dUM1Gjl2icDAC Executive passage\u003dI never wanted to be one, and as far as I\u0027m concerned, I\u0027m not a \u0027\u0027politician\u0027\u0027 now. Am I the best man for this job? Probably not. I am, however, the President of the United States\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A politically active or interested person\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"lt;!-- reminiscing about college days --\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A sly or ingratiating person\", \"priority\":7}]}, \"synonyms\":{}}");

