	add("politico", "{\"term\":\"politico\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Italian\"], \"text\":\"From Italian \u0027politico\u0027 Spanish \u0027político\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A politician\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0026quot;Connubial bliss in America\u0026quot;, \u0027The Economist\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And when the \u0027National Journal\u0027 polled political ‘insiders’ this month, it found a majority of Democratic \u0027\u0027politicos\u0027\u0027, lobbyists and strategists in favour of making gay marriage legal\", \"priority\":3}]}, \"synonyms\":{}}");

