	add("polity", "{\"term\":\"polity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027politie\u0027 from Latin \u0027politia\u0027 (circa. 1530s AD/CE), from Ancient greek (to 1453) \u0027πολιτεία\u0027 (polity, policy, the state) see policy.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organizational structure of the government of a state, church, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A politically organized unit; a state\", \"priority\":2}]}, \"synonyms\":{}}");

	add("polly", "{\"term\":\"polly\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female given name, nickname for Mary created by rhyming with Molly\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1860\u0027\u0027 Elizabeth Harcourt Mitchell, \u0027The Lighthouse\u0027, Saunders, Otley and co. 1860, page 161\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Well, Johnny,\u0026quot; she replied, rather hurt, \u0026quot;if you want to call me something else, you may do so; but I will not have any outlandish, ridiculous names. I don\u0027t like it much, but if you really wish it, you may call me \u0027\u0027Polly\u0027\u0027.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Polly\u0027\u0027, indeed! Mary was getting more and more prosaic\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A common name for a pet parrot\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pollard", "{\"term\":\"pollard\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027poll\u0027 (lang\u003denm) + \u0027-ard\u0027 The coin sense derives from the original penny\u0027s uncrowned obverse bust, as opposed to the laurel-wreathed form appearing on the rosary. The verb derives from the noun.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|A pollard willow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A pruned tree; the wood of such trees\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1869\u0027\u0027, w:Richard Doddridge Richard Doddridge Blackmore, \u0027w:Lorna Lorna Doone\u0027, s:Lorna Doone/Chapter Chapter 65\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Only a little \u0027\u0027pollard\u0027\u0027 hedge kept us from their blood-shot eyes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A buck deer that has shed his antler\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Hornless varieties of domestic animals, as cattle or goats\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The chub (\u0027Leuciscus L. cephalus\u0027), a kind of fish\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A fine grade of bran including some flour\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"13th-century European coins minted as debased counterfeits of the sterling silver penny of Edward I, at first legally accepted as a halfpenny and then outlawed\", \"priority\":9}]}, \"synonyms\":{}}");

	add("pollen", "{\"term\":\"pollen\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027pollen\u0027 (fine flour) (Used by Linnaeus in the 18th century to describe the spores produced in the anthers of flowers.)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Alcea rosea2 thumb|\u0027\u0027Pollen\u0027\u0027 grains on a flower\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Fine powder in general, fine flour (16th century usage documented by OED; no longer common\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;...and ther was good wyne of Gascoyne,... as well of pollen, as of other vitailes...\u0026quot; Froissart, Jean, 1338?-1410?; Berners, John Bourchier, Lord [https://archive.org/details/chroniclefroiss00froigoog\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A fine granular substance produced in flowers. Technically a collective term for pollen grains (microspores) produced in the anthers of flowering plants. (This specific usage dating from mid 18th century\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dIn plants, the ability to recognize self from nonself plays an important role in fertilization, because self-fertilization will result in less diverse offspring than fertilization with \u0027\u0027pollen\u0027\u0027 from another individual\", \"priority\":5}]}, \"synonyms\":{}}");

