	add("poltergeist", "{\"term\":\"poltergeist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|de|Poltergeist|lang\u003den}}, from {{compound|poltern|t1\u003dto rumble|Geist|t2\u003dspirit|lang\u003dde|nocat\u003dy}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unseen ghost which makes noises and causes disruption, especially by causing physical objects to move or fly about\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027poltergeist\u0027\u0027 haunts the house by moving objects around the house, make chain-rattling noises and throwing items\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the chapel is haunted by a demonic \u0027\u0027poltergeist\", \"priority\":3}]}, \"synonyms\":{}}");

	add("poltergeister", "{\"term\":\"poltergeister\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1854\u0027\u0027: Joseph Ennemoser, \u0027The History of Magic\u0027, p11\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"According to the pagan notion, the influence of spirits came from without; according to that of the Judaic–Christian system, the devil entered into the body of the man, and before the sorcerer could cease to practice his arts he must be expelled thence by spiritual force. Amongst the heathen, an idiot was supposed to be made so by the elves; the accused lunatic was said to be possessed. The elves stole the children of the heathen and left a changeling in its place: amongst the Christians, the devil entered the changeling. The devils, however, took possession of horses and cattle as well as of men, as Noisy Ghosts — \u0027\u0027Poltergeister\u0027\u0027. Amongst the heathen, at most, the little Grey Man took up his quiet abode there, not to mock, but to help, — not to terrify and injure\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1935\u0027\u0027: Alfred Emanuel Smith, \u0027New Outlook\u0027, p45\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They felt slaps from invisible beings — in short, all the manifestations traditionally attributed to \u0027\u0027\u0027Poltergeister\u0027\u0027\u0027 were reported as having occurred\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1947\u0027\u0027: Australasian Association of Philosophy, \u0027The Australasian Journal of Philosophy\u0027, p26\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"…whatever goes on inside must be the activity of spirits — especially \u0027\u0027poltergeister\u0027\u0027, in which Price believes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027: Martim de Albuquerque, \u0027Notes and Queries\u0027, p43\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"…men — haunted not by ghosts of the dead but by tiresome spirits such as \u0027\u0027Poltergeister\u0027\u0027 or the nightmare who may be conceived of as activities of a witch\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027: Peter Munz, \u0027Philosophical Darwinism: On the Origin of Knowledge by Means of Natural Selection\u0027, p7\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027: Jozef Conveleyn \u0026amp; Dirk Hutsebaut, \u0027Belief and Unbelief: Psychological Perspectives\u0027, p14\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Pars-religious interests: some Subjects showed interests in astrological maps, or parapsychological phenomena, or positive thinking power and communication, or horoscope, numerology, haunted houses and \u0027\u0027poltergeister\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"They are, after all, idiots, not mental \u0027\u0027poltergeister\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027: M. Owen Lee, \u0027Athena Sings: Wagner and the Greeks\u0027, p7\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"…)Sachs tells his people, after a Midsummer’s Eve when irrational \u0027\u0027Poltergeister\u0027\u0027 were on the loose, that if they respect their own traditions they will conjure…\", \"priority\":14}]}, \"synonyms\":{}}");

	add("poltophagy", "{\"term\":\"poltophagy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πόλτος\u0027 (porridge) and the suffix \u0027-φαγία\u0027 combining form of \u0027φαγεῖν\u0027 (to eat) See also suffix \u0027-phagy\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The chewing of food long enough to reduce it to the consistency of porridge\", \"priority\":1}]}, \"synonyms\":{}}");

	add("poltroon", "{\"term\":\"poltroon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Italian\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027poltron\u0027 from Italian \u0027poltrone\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ignoble or total coward; a dastard; a mean-spirited wretch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1842\u0027\u0027, w:Nicholas Nicholas Michell, \u0027The Traduced: An Historical Romance‎\u0027, page 266-26\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;To gain life by means of a breach of faith and honour, were indeed to render myself the \u0027\u0027poltroon\u0027\u0027, and the villain my accusers believe me.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1951\u0027\u0027, P. G. Wodehouse, \u0027The Old Reliable\u0027, Hutchinson, London: 1981, p 162\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The sounds outside had ceased...But somebody had been there, and she proposed to look into the matter thoroughly. There was nothing of the \u0027\u0027poltroon\u0027\u0027 about Adela Shannon Cork\", \"priority\":5}]}, \"synonyms\":{}}");

	add("poltroonery", "{\"term\":\"poltroonery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|poltroon|ery|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Cowardice; want of spirit; pusillanimity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1843\u0027\u0027, Thomas Carlyle, \u0027:w:Past and Present Past and Present\u0027, book 2, ch. IX, \u0027Abbot Samson\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Genius, Poet: do we know what these words mean? […] Nature’s own sacred voice heard once more athwart the dreary boundless element of hearsaying and canting, of twaddle and \u0027\u0027poltroonery\u0027\u0027, in which the bewildered Earth, nigh perishing, has \u0027lost its way\", \"priority\":3}]}, \"synonyms\":{}}");

