	add("polyamory", "{\"term\":\"polyamory\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From \u0027poly-\u0027 (from Ancient greek (to 1453) \u0027πολύς\u0027 (many) + Latin \u0027amor\u0027 (love) + \u0027-y\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various practices involving romantic or sexual relationships with multiple partners with the knowledge and consent of all involved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Deborah M. Anapol, \u0027Love without limits\u0027, page\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some of these are poly intimacy, \u0027\u0027polyamory\u0027\u0027, polygamy, omnigamy, multimate, multiple adult relationship, combo, cellular family, expanded family, nonexclusive relationship, intimate friendship and inclusive relationship\", \"priority\":3}]}, \"synonyms\":{}}");

	add("polyarch", "{\"term\":\"polyarch\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin from Ancient greek (to 1453) \u0027πολύς\u0027 (many) + \u0027ἀρχή\u0027 (beginning)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of many rulers, many leaders\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A root that has many xylem bundles\", \"priority\":2}]}, \"synonyms\":{}}");

