	add("polycentrism", "{\"term\":\"polycentrism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|centrism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a political or cultural system which contains many different centres, especially centres of authority or contro\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the existence of multiple central part\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the existence of more than one culture in a particular country or regio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, John Kearns (ed.), \u0027Translator and Interpreter Training: Issues, Methods and Debates\u0027, Continuum International Publishing Group, page 79\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Polycentrism\u0027\u0027: Continuous contact with individuals belonging to foreign cultures can lead to an acceptance that there are different cultures and different behavioural norms depending on the culture of origin\", \"priority\":5}]}, \"synonyms\":{}}");

