	add("polygamia", "{\"term\":\"polygamia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Late Latin \u0027polygamia\u0027 from Ancient greek (to 1453) \u0027πολυγαμία\u0027 itself from \u0027πολύγαμος\u0027 (married to many) from \u0027πολύς\u0027 (many) + \u0027γάμος\u0027 (marriage) Relates to modern prefix \u0026amp; suffix {{confix|poly|gamy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A \u0027Linnæan\u0027 class of plants, characterized by having both hermaphrodite and unisexual flowers on the same plant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A name given by Linnæus to file orders of plants having syngenesious flowers\", \"priority\":2}]}, \"synonyms\":{}}");

