	add("polygordius", "{\"term\":\"polygordius\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A marine annelids of genus , believed to be an ancient or ancestral type. It is remarkable for its simplicity of structure and want of parapodia. It is the type of the order Archiannelida, or\", \"priority\":1}]}, \"synonyms\":{}}");

