	add("polygyny", "{\"term\":\"polygyny\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πολύ\u0027 (many) + \u0027γυνή\u0027 (woman, wife)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or practice of having several wives at the same time; plurality of wives; marriage to several wives - w:Herbert H. Spencer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polyhalite", "{\"term\":\"polyhalite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral usually occurring in fibrous masses, of a brick-red color, being tinged with iron, and consisting chiefly of the sulphates of lime, magnesia, and soda\", \"priority\":1}]}, \"synonyms\":{}}");

