	add("polyhierarchy", "{\"term\":\"polyhierarchy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|hierarchy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hierarchical relationship (tree) in which at least one child has more than one parent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polyhistidine", "{\"term\":\"polyhistidine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Several histidine residues linked together (usually at least six\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polyhydramnios", "{\"term\":\"polyhydramnios\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An excess of amniotic fluid in the amniotic sac\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polykite", "{\"term\":\"polykite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|kite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A polyform constructed from quadrilaterals obtained from the superimposition of a triangular and hexagonal grid\", \"priority\":1}]}, \"synonyms\":{}}");

