	add("polymath", "{\"term\":\"polymath\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"First attested in 1624; from the Ancient greek (to 1453) \u0027πολυμαθής\u0027 (having learnt much) from \u0027πολύς\u0027 (much) + \u0027μάθη\u0027 (\u0027mathē\u0027, “learning”; from \u0027μανθάνω\u0027 \u0027manthanō\u0027 “I learn”); compare \u0027opsimath\u0027 \u0027philomath\u0027 \u0027polyhistor\u0027 \u0027polymathic\u0027 \u0027polymathist\u0027 and \u0027polymathy\u0027 as well as the French \u0027polymathe\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person with extraordinarily broad and comprehensive knowledge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1624\u0027\u0027, \u0027\u0027 (2\u0026lt;sup\u0026gt;nd\u0026lt;/sup\u0026gt; edn.), p.6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To be thought and held \u0027\u0027Polumathes\u0027\u0027 and Polihistors\", \"priority\":3}]}, \"synonyms\":{}}");

	add("polymathy", "{\"term\":\"polymathy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ultimately from Ancient greek (to 1453) {{m|grc|πολυμαθής||having learnt much}}; surface analysis {{suffix|polymath|y|t2\u003dhaving the quality of}}. See {{m|en|polymath}} for details.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The knowledge of many arts and sciences; variety of learning\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymer", "{\"term\":\"polymer\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{confix|poly|mer|lang\u003den}}, from Ancient greek (to 1453) \u0027πολύς\u0027 (many) + \u0027μέρος\u0027 (part) Coined in 1833 by Jöns Jacob Berzelius, although his definition was quite different from ours.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long or larger molecule consisting of a chain or network of many repeating units, formed by chemical chemically bonding together many identical or similar small molecules called monomers. A polymer is formed by polymerization, the joining of many monomer molecules\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A material consisting of such polymer molecules\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dSimilar studies of rats have employed four different intracranial resorbable, slow sustained release systems\u0026amp;mdash;surgical foam, a thermal gel depot, a microcapsule or biodegradable \u0027\u0027polymer\u0027\u0027 beads\", \"priority\":3}]}, \"synonyms\":{}}");

	add("polymeride", "{\"term\":\"polymeride\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|polymer|ide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Polymer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymerization", "{\"term\":\"polymerization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|polymerize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The chemical process, normally with the aid of a catalyst, to form a polymer by bonding together multiple identical units (monomers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymethine", "{\"term\":\"polymethine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|methine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A compound made up from an odd number of methine groups bound together by alternating single and double bonds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymethyl", "{\"term\":\"polymethyl\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"in combination\u0027) Any of various polymers whose respective monomer is a methyl derivative; Any of various compounds having many methyl groups\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymicrogyria", "{\"term\":\"polymicrogyria\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From poly- + micro- + gyrus\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A deformity of the brain such that it has an excessive number of small folds, causing mental retardation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymorph", "{\"term\":\"polymorph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|poly|morph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any organism that shows polymorphis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any substance or mineral that forms different types of crystal\", \"priority\":2}]}, \"synonyms\":{}}");

	add("polymorphism", "{\"term\":\"polymorphism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|poly|morphism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability to assume different forms or shapes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The coexistence, in the same locality, of two or more distinct forms independent of sex, not connected by intermediate gradations, but produced from common parents\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The feature of object-oriented programming pertaining to the dynamic treatment of data elements based on their type, allowing for an instance of a method to have several definitions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The property of certain typed formal systems of allowing for the use of type variables and binders/quantifiers over those type variables; likewise, the property of certain expressions (within such typed formal systems) of making use of at least one such typed variable\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The ability of a solid material to exist in more than one form or crystal structure; pleomorphism\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The regular existence of two or more different genotypes within a given species or population; also, variability of amino acid sequences within a gene\u0027s protein\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027Genome\u0027, Harper Perennial 2004, p. 137\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Since 1990 they have found an entirely new role: they promise understanding of how and why our genes are all so different. They hold the key to human \u0027\u0027polymorphism\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Ancestor\u0027s Tale\u0027, Phoenix 2005, p. 63\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Some \u0027\u0027polymorphisms\u0027\u0027 can be quite stable – so stable that they span the change from an ancestral to a descendant species\", \"priority\":10}]}, \"synonyms\":{}}");

	add("polymorphitis", "{\"term\":\"polymorphitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|polymorph|itis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In some roguelike games, an intrinsic ability that causes the player\u0027s character to polymorph without warning\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymorphosis", "{\"term\":\"polymorphosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The assumption of several structural forms without a corresponding difference in function; -- said of sponges, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymorphy", "{\"term\":\"polymorphy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|poly|morphy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The existence of many different forms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polynesia", "{\"term\":\"polynesia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πολύς\u0027 (many) + \u0027νῆσος\u0027 (island) according to Moon Handbooks Tahiti, \u0026quot;the term Polynesia was coined by Charles de Brosses in 1756 and applied to all the Pacific islands. The present restricted use was proposed by Dumont d\u0027Urville during a famous lecture at the Geographical Society in Paris in 1831.\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Part of Oceania including Easter Island, Hawaii, New Zealand, and most of the islands between them\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polynitrogen", "{\"term\":\"polynitrogen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|nitrogen|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several unstable allotropes of nitrogen that have more than two atoms in each molecule\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polynomiography", "{\"term\":\"polynomiography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An iterative process used to create two-dimensional coloured images (polynomiographs) that are the representations of polynomials\", \"priority\":1}]}, \"synonyms\":{}}");

