	add("polyol", "{\"term\":\"polyol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|poly|ol|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any organic compound having three or more hydroxyl functional groups; a polyhydric alcohol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027A Short History of Nearly Everything\u0027, BCA 2003, p. 258\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a team at the Ames Research Center in California announced that the Murchison rock also contained complex strings of sugars called \u0027\u0027polyols\u0027\u0027, which had not been found off the Earth before\", \"priority\":3}]}, \"synonyms\":{}}");

