	add("polyploidy", "{\"term\":\"polyploidy\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From {{suffix|polyploid|y|lang\u003den}}, after German \u0027polyploidie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being a polyploid; having more than the usual two homologous sets of chromosomes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Terence Allen and Graham Cowling, \u0027The Cell: A Very Short Introduction\u0027, Oxford 2011, p. 90\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As they mature, the DNA is replicated several times but the cell does not divide, a condition known as \u0027\u0027polyploidy\u0027\u0027 which allows cells to increase in size\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21605869-vegetable-kingdom-more-sets-chromosomes-are-often-better-double-or Double or passage\u003dThis propensity to \u0027\u0027polyploidy\u0027\u0027 helps account for the diversity (and thus success) of flowering plants, in particular. It is also known that flowering plants sailed majestically through the life-destroying asteroid impact at the end of the Cretaceous period, which did for the dinosaurs and many other animals\", \"priority\":4}]}, \"synonyms\":{}}");

