	add("polysyllabicity", "{\"term\":\"polysyllabicity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of being polysyllabic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1943\u0027\u0027, John de Francis, \u0026quot;The Alphabetization of Chinese,\u0026quot; \u0027Journal of the American Oriental Society\u0027, vol. 63, no. 4 (Oct/Dec), p. 235\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The drift of the Chinese language toward greater \u0027\u0027polysyllabicity\u0027\u0027 is seen even more clearly in the fact that not more than 15 percent of the Chinese equivalents of foreign technical terms consist of only one syllable\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Jay Newhard, \u0026quot;Grelling\u0027s Paradox,\u0026quot; \u0027Philosophical Studies\u0027, Springer, vol. 126, no. 1, p. 2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Polysyllabicity\u0027\u0027\u0026quot; and \u0026quot;utterableness\u0026quot; each has the word-property it designates\", \"priority\":5}]}, \"synonyms\":{}}");

